import React, { useEffect, useState } from 'react'
import profile from '../assets/female_doctor.webp'
import axios from 'axios';
const Profile = () => {


    const [data, setData] = useState([]);
    const url = 'http://localhost:5050/auth/user';

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(url);
                setData(response.data);
            } catch (error) {
                console.log(error);
            }
        };

        fetchData();
    }, [url]);

    console.log(data);
    return (
        <div className='d-flex justify-content-center align-items-center mx-auto  m-3 '>
            <div className='d-flex border border-primary justify-content-center align-items-center  flex-column ' style={{ width: '98%', height: '70vh' }}>
                <div >
                    <img src={profile} alt="" style={{ width: '5rem', borderRadius: '50%' }} />
                </div>
                <div>
                    <div className="d-flex flex-column" style={{ width: '20vw' }}>
                        <label htmlFor="time">First Name</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>
                    <div className="d-flex flex-column " style={{ width: '20vw' }} >
                        <label htmlFor="time">Last Name</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>
                    <div className="d-flex flex-column " style={{ width: '20vw' }}>
                        <label htmlFor="time">Email</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Profile
